import {
  Button,
  Card,
  Form,
  FormLayout,
  Layout,
  Page,
  Stack,
  TextField,
  TextStyle,
  EmptyState
} from '@shopify/polaris';
import '@shopify/polaris/styles.css';

const Index = () => (
  
  <Page>

    <Layout>
      <div className="header">
      <Card>
        <p>Esta es una tarjetota</p>
      </Card>
      </div>

    </Layout>
  </Page>
);

export default Index;
